INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, "調子が上がって\nきたなっ", 2, 1, 2, "vo_minigame_1013_icon_1_002_001", 1000, 3000, "訓練はまだ\nここからですわ", "vo_minigame_1013_icon_2_002_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (2, "ほらほら、\nまだいけるだろ？", 2, 2, 2, "vo_minigame_1013_icon_1_003_001", 5000, 3000, "クスクス、悪くない\n流れですわね", "vo_minigame_1013_icon_2_003_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, "へへっ、おまえら\nやるじゃねえか！", 2, 3, 2, "vo_minigame_1013_icon_1_004_001", 10000, 3000, "すばらしい\n記録ですわ", "vo_minigame_1013_icon_2_004_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, "あたしたちはまだ\n止まらねえぜ！", 3, 4, 2, "vo_minigame_1013_icon_1_005_001", 10000, 3000, "乗りに乗って\nいますわね", "vo_minigame_1013_icon_2_005_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, "見てろよ！\nマコト班の快進撃だ！", 3, 5, 2, "vo_minigame_1013_icon_1_005_002", 10000, 3000, "まだまだ行きます\nついてきなさい", "vo_minigame_1013_icon_2_005_002");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, "うおぉぉっ！\n絶好調だぜ！", 3, 6, 2, "vo_minigame_1013_icon_1_005_003", 10000, 3000, "エリコ班の\n本領発揮ですわ！", "vo_minigame_1013_icon_2_005_003");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, "どこまで行けるか\n楽しみだなっ！", 4, 7, 2, "vo_minigame_1013_icon_1_006_001", 0, 3000, "ここからは\n前人未到の領域です！", "vo_minigame_1013_icon_2_006_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (4, "まだ諦めんなよっ", 5, 8, 3, "vo_minigame_1013_icon_1_007_001", 1, 1000, "厄介でしたわ…", "vo_minigame_1013_icon_2_007_001");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (4, "冷やっとしたぜ…！", 5, 9, 3, "vo_minigame_1013_icon_1_007_002", 1, 1000, "油断大敵です", "vo_minigame_1013_icon_2_007_002");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (4, "弱音を吐くなっ", 5, 10, 3, "vo_minigame_1013_icon_1_007_003", 1, 1000, "忌々しいっ…", "vo_minigame_1013_icon_2_007_003");
INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (3, "マコト班集合！", 6, 11, 4, "vo_minigame_1013_icon_1_008_001", 99, 1500, "大所帯ですわね", "vo_minigame_1013_icon_2_008_001");
