INSERT INTO `v1_5f71f9476febf098e7d29c7639bc4babf9baa498dd7846417687d6335642ed73` VALUES (6, "みんなに力を！", 8, 13, 1, "vo_minigame_1013_icon_1_020_001", 0, 3000, "ナナカちゃんに\nお任せあれ", "vo_minigame_1013_icon_2_020_001");
